// ];

export default class Projects extends Component {
  constructor(props) {
    super(props);

    // this.deleteProjects = this.deleteProjects.bind(this)

    this.state = { Projects: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5007/create/")
      .then((response) => {
        this.setState({ Projects: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return (<div>
       <Navbar />
      <div className="cards">
        {Projects.map((item,index) => {
          return <ProjectCard data={item._id} />;
        })}

      </div>
      <Footer />
      </div>
    );
  }
}
